function Hero() {
  return (
    <section className='h-96 bg-blue-600 text-white'>
    <div className='flex justify-center items-center flex-col py-42'>
      <h1 className='text-6xl'>IMAGINE A PLACE...</h1>
      <p className='w-3/5 text-xl mt-8'>...where you can belong to a school club, a gaming group, or a worldwide art community. Where just you and a handful of friends can spend time together. A place that makes it easy to talk every day and hang out more often.</p>
    </div>
    </section>
  )
}

export default Hero
